--
-- Create function `Func_CheckEqual`
--
CREATE DEFINER = 'root'@'localhost'
FUNCTION Func_CheckEqual (str1 varchar(255), str2 varchar(255))
RETURNS tinyint(1)
BEGIN
  -- Kiểm tra xem chuôi tìm kiếm có chứa unicode không
  IF (REPLACE(CONVERT(str1 USING ascii), '?', '') = str1) THEN
    -- TH không chứa unicode
    -- dùng like bình thường không phân biệt unicode
    IF (str2 LIKE CONCAT('%', str1, '%')) THEN
      RETURN TRUE;
    ELSE
      RETURN FALSE;
    END IF;
  ELSE
    -- TH có chưa unicode
    -- bắt buộc phải giống cả unicode
    IF str2 LIKE CONCAT('%', BINARY str1, '%') THEN
      RETURN TRUE;
    ELSE
      RETURN FALSE;
    END IF;
  END IF;
  RETURN 1;
END
$$

--
-- Create procedure `Proc_GetEmployeesFilter`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_GetEmployeesFilter (IN EmployeeFilter varchar(255))
COMMENT 'Lọc giáo viên theo Số hiệu, Tên'
BEGIN
  SET @EmployeeFilter = (SELECT
      EmployeeFilter);
  CREATE TEMPORARY TABLE FilteredTable
  SELECT
    e.EmployeeId,
    e.EmployeeCode,
    e.EmployeeImageUrl,
    e.FullName,
    e.PhoneNumber,
    e.Email,
    e.IsTrained,
    e.IsActive,
    e.EndJobDate,
    e.DepartmentId,
    e.DepartmentName,
    e.DepartmentDescription,
    e.Subject,
    e.EquipmentRoom,
    e.CreatedDate,
    e.CreatedBy,
    e.ModifiedDate,
    e.ModifiedBy
  FROM view_employee e
  WHERE (@EmployeeFilter <=> NULL
  OR Func_CheckEqual(LOWER(@EmployeeFilter), LOWER(e.EmployeeCode))
  OR Func_CheckEqual(LOWER(@EmployeeFilter), LOWER(e.FullName)))
  ORDER BY e.CreatedDate DESC;

  SELECT
    *
  FROM FilteredTable;
END
$$

